      <Link color="inherit" href="https://material-ui.com/">
        Your Website
      </Link>{' '}
      {new Date().getFullYear()}
      {'.'}
    </Typography>
  );
}

const useStyles = makeStyles(theme => ({
  paper: {
    marginTop: theme.spacing(8),
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
  },
  avatar: {
    margin: theme.spacing(1),
    backgroundColor: theme.palette.secondary.main,
  },
  form: {
    width: '100%', // Fix IE 11 issue.
    marginTop: theme.spacing(3),
  },
  submit: {
    margin: theme.spacing(3, 0, 2),
  },
}));


const useSelectStyles = makeStyles(theme => ({
  formControl: {
    margin: theme.spacing(1),
    minWidth: 120,
    maxWidth: 300,
  },
  chips: {
    display: 'flex',
    flexWrap: 'wrap',
  },
  chip: {
    margin: 2,
  },
  noLabel: {
    marginTop: theme.spacing(3),
  },
}));

const ITEM_HEIGHT = 48;
const ITEM_PADDING_TOP = 8;
const MenuProps = {
  PaperProps: {
    style: {
      maxHeight: ITEM_HEIGHT * 4.5 + ITEM_PADDING_TOP,
      width: 250,
    },
  },
};



const names = [
  'Casado',
  'Soltero',
  'Unión Libre',
  'Divorciado',
  'Viudo'
];

const nivel_estudios = [
  'Terminada',
  'Incompleta'
];

const tipo_puesto = [
  'Operativo',
  'Profesional ó técnico',
  'Supervisor',
  'Gerente'
];

const tipo_contratacion = [
  'Por obra o proyecto',
  'Por tiempo determinado (temporal)',
  'Tiempo indeterminado',
  'Honorarios'
]

const tipo_personal = [
  'Sindicalizado',
  'Confianza',
  'Ninguno'
]

const tipo_jornada_trabajo = [
  'Fijo nocturno (entre 20:00 y 6:00 hrs)',
  'Fijo diurno (entre las 6:00 y 20:00 hrs)',
  'Fijo mixto (combinación de nocturno y diurno)'
]

const tiempo_puesto_actual = [
  'Menos de 6 meses',
  'Entre 6 meses y  1 año',
  'Entre 1 a 4 años',
  'Entre 5 a 9 años',
  'Entre 10 a 14 años',
  'Entre 15 a 19 años',
  'Entre 20 a 24 años',
  '25 años o más'
]

const tiempo_exp_laboral = [
  'Menos de 6 meses',
  'Entre 6 meses y  1 año',
  'Entre 1 a 4 años',
  'Entre 5 a 9 años',
  'Entre 10 a 14 años',
  'Entre 15 a 19 años',
  'Entre 20 a 24 años',
  '25 años o más'
]




const useRadioStyles = makeStyles({
  root: {
    '&:hover': {
      backgroundColor: 'transparent',
    },
  },
  icon: {
    borderRadius: '50%',
    width: 16,
    height: 16,
    boxShadow: 'inset 0 0 0 1px rgba(16,22,26,.2), inset 0 -1px 0 rgba(16,22,26,.1)',
    backgroundColor: '#f5f8fa',
    backgroundImage: 'linear-gradient(180deg,hsla(0,0%,100%,.8),hsla(0,0%,100%,0))',
    '$root.Mui-focusVisible &': {
      outline: '2px auto rgba(19,124,189,.6)',
      outlineOffset: 2,
    },
    'input:hover ~ &': {
      backgroundColor: '#ebf1f5',
    },
    'input:disabled ~ &': {
      boxShadow: 'none',
      background: 'rgba(206,217,224,.5)',
    },
  },
  checkedIcon: {
    backgroundColor: '#137cbd',
    backgroundImage: 'linear-gradient(180deg,hsla(0,0%,100%,.1),hsla(0,0%,100%,0))',
    '&:before': {
      display: 'block',
      width: 16,
      height: 16,
      backgroundImage: 'radial-gradient(#fff,#fff 28%,transparent 32%)',
      content: '""',
    },
    'input:hover ~ &': {
      backgroundColor: '#106ba3',
    },
  },
});

// Inspired by blueprintjs
function StyledRadio(props) {
  const classes = useRadioStyles();

  return (
    <Radio
      className={classes.root}
      disableRipple
      color="default"
      checkedIcon={<span className={clsx(classes.icon, classes.checkedIcon)} />}
      icon={<span className={classes.icon} />}
      {...props}
    />
  );
}


//radiobuttons
const [state, setState] = React.useState({
  gilad: true,
  jason: false,
  antoine: false,
});

const handleChange = name => event => {
  setState({ ...state, [name]: event.target.checked });
};

const { gilad, jason, antoine } = state;
const error = [gilad, jason, antoine].filter(v => v).length !== 2;

function getSelectStyles(name, personName, theme) {
  return {
    fontWeight:
      personName.indexOf(name) === -1
        ? theme.typography.fontWeightRegular
        : theme.typography.fontWeightMedium,
  };
}


export default function SignUp() {
  const theme = useTheme();
  const classes = useStyles();
  const [personName, setPersonName] = React.useState([]);
  const handleChange = event => {
    setPersonName(event.target.value);
  };

  const [nombre, setNombre] = useState('fsdfds')
  const [paterno, setPaterno] = useState('')
